Require Import mathcomp.ssreflect.seq.

Set Implicit Arguments.
Unset Strict Implicit.
Unset Printing Implicit Defensive.

Require Import Interval.Interval_specific_ops.
Require Import Interval.Interval_bigint_carrier.
Require Import Interval.Interval_definitions.
Module F := SpecificFloat BigIntRadix2.
Require Import BigZ.
Local Open Scope bigZ_scope.

Definition add := F.add rnd_NE 53%bigZ.
Definition mul := F.mul rnd_NE 53%bigZ.
Definition sqrt := F.sqrt rnd_NE 53%bigZ.
Definition div := F.div rnd_NE 53%bigZ.
Definition opp := F.neg.
Definition zero := F.zero.

Section cholesky.

Fixpoint seq_stilde0 k c a b :=
  match k, a, b with
    | O, _, _ => c
    | S k, [::], _ => c
    | S k, _, [::] => c
    | S k, a1 :: a2, b1 :: b2 => seq_stilde0 k (add c (opp (mul a1 b1))) a2 b2
  end.

Definition seq_ytilded0 k c a b bk := div (seq_stilde0 k c a b) bk.

Definition seq_ytildes0 k c a := sqrt (seq_stilde0 k c a a).

Fixpoint seq_store0 T s n (v : T) :=
  match n, s with
    | _, [::] => [::]
    | O, _ :: t => v :: t
    | S n, h :: t => h :: seq_store0 t n v
  end.

Fixpoint store0 T m i j (v : T) :=
  match i, m with
    | _, [::] => [::]
    | O, h :: t => seq_store0 h j v :: t
    | S i, h :: t => h :: store0 t i j v
  end.

Section InnerLoop.
Variable j : nat.
Fixpoint inner_loop_rec2 (k : nat) A R (i : nat) {struct k} :=
  match k with
  | O (* i >= j) *) => R
  | S k => let R := store0 R j i (seq_ytilded0 i (nth zero (nth [::] A i) j)
                                             (nth [::] R i) (nth [::] R j)
                                             (nth zero (nth [::] R i) i)) in
           inner_loop_rec2 k A R (S i)
  end.
Definition inner_loop2 A R i := inner_loop_rec2 (j - i) A R i.
End InnerLoop.

Section OuterLoop.
Variable n : nat.
Fixpoint outer_loop_rec2 k A R (j : nat) {struct k} :=
  match k with
  | O (* j >= n *) => R
  | S k =>
    let R := inner_loop2 j A R 0 in
    let R := store0 R j j (seq_ytildes0 j (nth zero (nth [::] A j) j)
                                      (nth [::] R j)) in
    outer_loop_rec2 k A R (j + 1)
  end.
Definition outer_loop2 A R j := outer_loop_rec2 (n - j) A R j.
End OuterLoop.

Definition cholesky2 A :=
  let sz := seq.size A in
  outer_loop2 sz A A 0.

End cholesky.

